import React from 'react'
import styled from 'styled-components';

function TimePicker() {

    const StyledTimePicker = styled.div`
        display: flex;
        flex-direction: column;

        & button{
            border: none;
            cursor: pointer;

        }
    `;
    return (
        <StyledTimePicker>
            <div>
                {[...Array(12)].map((v,i) => 
                    <button value={i}>{i}</button>)}
            </div>

            <div className="TimePicker-minute">
                {[...Array(60)].map((v,i) => 
                    <button value={i}>{i}</button>)}
            </div>

        </StyledTimePicker>
    )
}

export default TimePicker
